// In this example, I've added a DateRangePicker component to each of your div boxes. I've used the LocalizationProvider component from Material UI to provide a date library that the DateRangePicker can use. I've chosen AdapterDateFns, but you can choose any date library that you prefer.

// The DateRangePicker component uses two props to manage its state: value and onChange. value is an array of two elements that represent the start and end dates, and onChange is a function that's called whenever the user changes the date.

// In this case, I've used a single state (value) for both DateRangePicker instances. If you want them to maintain separate states, you will need to create separate state variables.

import "../../CSS/imager_settings.css";
import { Container, Row, Col } from "react-bootstrap";
import React, { useState } from "react";
import CommonRow from "../../components/CommonRow";
import { ReactComponent as FieldDockLogo } from "../../assets/FieldDock-Logo.svg";
import { LocalizationProvider } from "@mui/x-date-pickers";
import { DateRangePicker } from "@mui/lab";
import AdapterDateFns from "@mui/lab/AdapterDateFns";

function Imager_Settings() {
  const [selectedInterval, setSelectedInterval] = useState(
    "Select time interval..."
  );

  const handleSelect = (event) => {
    setSelectedInterval(event.target.value);
  };

  function handleHover(e) {
    e.target.style.borderColor = "#00e1b4";
    e.target.style.color = "orange";
  }

  function handleUnhover(e) {
    e.target.style.borderColor = "orange";
    e.target.style.color = "#e0e0e0";
  }

  // // Add as many state variables as you need.
  // Here I've added just one for simplicity.
  const [value, setValue] = React.useState([null, null]);
  //-------------------------------------------------------
  return (
    <LocalizationProvider dateAdapter={AdapterDateFns}>
      <Container fluid>
        <div>
          <CommonRow />
        </div>
        {/* ------------------------------------------------- row 1 END ----------------------------- */}
        <Row>
          <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
            <div className="sensor-measurement-settings">
              <div className="sensor-measurement-settings-title">
                Download Data
              </div>
            </div>
          </Col>
        </Row>
        <Row>
          {/* ------------------------------------------------- row 2 END ----------------------------- */}
          <Col xs={6} sm={6} md={6} lg={6} xl={6} xxl={6}>
            <div className="sensor-modules">
              <div className="sensor-modules-title">
                Download Environmental Data
              </div>
              <div className="sensor-modules-content">
                <DateRangePicker
                  startText="Start date"
                  endText="End date"
                  value={value}
                  onChange={(newValue) => {
                    setValue(newValue);
                  }}
                  renderInput={(startProps, endProps) => (
                    <React.Fragment>
                      <input {...startProps} style={{ marginRight: "1em" }} />
                      <input {...endProps} />
                    </React.Fragment>
                  )}
                />
              </div>
            </div>
          </Col>
        </Row>
        {/* ------------------------------------------------- row 3 END ----------------------------- */}
        <Row>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} xxl={6}>
            <div className="sensor-modules">
              <div className="sensor-modules-title">
                Download FieldDock Images
              </div>
              <div className="sensor-modules-content"></div>
            </div>
          </Col>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} xxl={6}>
            <div className="wireless-modules">
              <div className="wireless-modules-title">
                Download Mosaicked Drone Images
              </div>
              <div className="wireless-modules-content"></div>
            </div>
          </Col>
        </Row>
        {/* ------------------------------------------------- row 4 END ----------------------------- */}
        <Row>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} xxl={6}>
            <div className="sensor-modules">
              <div className="sensor-modules-title">Download Drone Data</div>
              <div className="sensor-modules-content"></div>
            </div>
          </Col>
          <Col xs={6} sm={6} md={6} lg={6} xl={6} xxl={6}>
            <div className="wireless-modules">
              <div className="wireless-modules-title">
                Download Wireless Sensor Data
              </div>
              <div className="wireless-modules-content"></div>
            </div>
          </Col>
        </Row>
        {/* ------------------------------------------------- row 5 END ----------------------------- */}

        <Row>
          <Col xs={12} sm={12} md={12} lg={12} xl={12} xxl={12}>
            <div className="image-preference-box">
              <div className="checkboxes">
                <label>
                  <input class="group-checkbox" type="checkbox" />
                  <span>
                    Apply the above imaging settings to all FieldDock systems in
                    this group
                  </span>
                </label>
                <label>
                  <input class="all-checkbox" type="checkbox" />
                  <span>
                    Apply the above imaging settings to all FieldDock systems in
                    this account
                  </span>
                </label>
              </div>
              <div
                className="image-preferences-button"
                onMouseOver={handleHover}
                onMouseOut={handleUnhover}
              >
                <button>Save all imaging preferences</button>
              </div>
            </div>
          </Col>
        </Row>

        {/* ------------------------------------------------- row 5 END ----------------------------- */}
      </Container>
    </LocalizationProvider>
  );
}

export default Imager_Settings;
